    false,nt"url": null,nt"notes": "The Memphis, TN EnviroAtlas One Meter-scale
    Urban Land Cover (MULC) dataset comprises 2,733 km2 around the city of Memphis,
    surrounding towns, and rural areas. These leaf-on LC data and maps were derived
    from 1-m pixel, four-band (red, green, blue, and near-infrared) aerial photography
    acquired from the United States Department of Agriculture (USDA) National Agriculture
    Imagery Program (NAIP) on four dates in 2012: June 15, June 18, June 21 and June
    23, and one date in 2013: July 12. Three separate LiDAR (Light Detection and Ranging)
    data sets collected on February 19, 2009 u00e2?? August 2, 2010, December 1-2, 2011
    and January 23-24, 2012 were integrated for Shelby Co., TN, Crittenden Co., AR,
    and DeSoto Co, MS. Five MULC classes were mapped directly from the NAIP and LiDAR
    data: Water, Impervious, Soil, Trees, and Grass/Herbaceous. Agriculture was derived
    from USDA Common Land Unit (CLU) data. Woody and emergent wetlands were copied from
    existing National Wetlands Inventory (NWI) data. Analysis of a random sampling of
    612 photo-interpreted land cover reference points yielded an overall users accuracy
    of 86.9%. This dataset was produced by the US EPA to support research and online
    mapping activities related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas)
    allows the user to interact with a web-based, easy-to-use, mapping application to
    view and analyze multiple ecosystem services for the contiguous United States. The
    dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
    or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
